.gw-go-col-wrap .gw-go-col.gw-go-auxin_modern .gw-go-col-inner {
	background-color: transparent;
  	padding: 53px 30px 70px 30px !important;
}
.gw-go-col-wrap:nth-child(2) .gw-go-col.gw-go-auxin_modern .gw-go-col-inner {
    background: rgba(234,56,77,1);
    background: -moz-linear-gradient(150deg, rgba(234,56,77,1) 0%, rgba(211,16,39,1) 100%);
    background: -webkit-gradient(150deg, right top, color-stop(0%, rgba(234,56,77,1)), color-stop(100%, rgba(211,16,39,1)));
    background: -webkit-linear-gradient(150deg, rgba(234,56,77,1) 0%, rgba(211,16,39,1) 100%);
    background: -o-linear-gradient(150deg, rgba(234,56,77,1) 0%, rgba(211,16,39,1) 100%);
    background: -ms-linear-gradient(150deg, rgba(234,56,77,1) 0%, rgba(211,16,39,1) 100%);
    background: linear-gradient(150deg, rgba(234,56,77,1) 0%, rgba(211,16,39,1) 100%);
    filter: progid:DXImageTransform.Microsoft.gradient( startColorstr='#ea384d', endColorstr='#d31027', GradientType=1 );
}

.aux-gym-heading-wrapper .aux-gym-table-header {
	font-family: "Poppins", Sans-serif;
    font-size: 30px !important;
    font-weight: 900 !important;
    font-style: italic;
  	line-height: 45px !important;
  	color: #FF2A43;
 	margin-bottom: 6px !important;
}

.gw-go-col-wrap:nth-child(2) .aux-gym-heading-wrapper .aux-gym-table-header {
	color: #000;
}

.aux-gym-heading-wrapper .aux-gym-table-subtitle {
	font-family: "Montserrat", Sans-serif;
    font-size: 20px !important;
    font-weight: 400 !important;
  	line-height: 24px !important;
  	color: #FFFFFF;
  	position: static;
  	
}
.gw-go-col-wrap .gw-go-col.gw-go-auxin_modern {
	border: none;
  	overflow: hidden;
}
.aux-gym-price-wrapper .aux-gym-price {
	font-family: "Oswald", Sans-serif;
  	font-size: 90px;
  	font-weight: bold;
  	display: inline-block;
  	line-height: 133px;
  	color: #FFFFFF;
}

.aux-gym-price-wrapper .aux-gym-currency {
    vertical-align: top;
    font-family: "Poppins", Sans-serif;
    font-size: 37px;
    font-weight: 600;
    color: #FFF;
    line-height: 56px;
    top: 10px;
    position: relative;
}

.aux-gym-price-wrapper .aux-gym-payment {
    font-family: "Poppins", Sans-serif;
    font-size: 30px;
    font-weight: 400;
    color: #FFF;
    line-height: 46px;
    position: relative;
    left: -24px;
    bottom: 2px;
}

.gw-go-col-wrap:nth-child(2) .aux-gym-price-wrapper .aux-gym-payment,
.gw-go-col-wrap:nth-child(2) .aux-gym-price-wrapper .aux-gym-currency,
.gw-go-col-wrap:nth-child(2) .aux-gym-price-wrapper .aux-gym-price {
	color: #000;
}

.aux-gym-total-price-wrapper .aux-gym-price {
  	font-family: "Poppins", Sans-serif;
  	font-size: 20px;
  	display: block;
  	text-align: center;
  	color: #FFF;
  	line-height: 28px;
  	font-weight: 600;
}

.aux-gym-total-price-wrapper .aux-gym-payment {
  	font-family: "Poppins", Sans-serif;
  	font-size: 20px;
  	display: block;
  	text-align: center;
  	font-weight: 200;
  	color: #FFF;
  	line-height: 28px;
}

.gw-go-col-wrap .gw-go-col.gw-go-auxin_modern .gw-go-body {
	margin-top: 23px !important;
}

.gw-go-col-wrap .gw-go-col.gw-go-auxin_modern .gw-go-body li {
	padding: 0 !important;
  	color: #FFF;
}

.gw-go-col-wrap .gw-go-col.gw-go-auxin_modern .aux-gw-go-hr {
  	display: none;
}

.gw-go-col:before {
  display: none;
}

